        N'<![CDATA[ <br />Kursen ger dig möjlighet att utveckla grundläggande förmågor i att lära och studera med hjälp av digitala verktyg, ger dig kunskap kring olika faktorer som kan påverka din inlärning samt träning i att navigera i en digital värld. Du får även lära dig att använda både datorn och mobilen till kommunikation, informationssök och digitala hjälpmedel för att hitta det sätt du lär dig bäst på.<br /><br />I våra orienteringskurser utvecklas entreprenöriellt lärande, såsom initiativförmåga, kreativitet, ansvar och nyfikenhet. Kurserna ska även utveckla din digitala kompetens och språkliga förmåga.<br /><br />Du har möjlighet att söka studiemedel för den här kursen.<br /><a href=http://www.csn.se/>Läs mer om studiemedel på&nbsp;www.csn.se</a>.<br />&nbsp;<br />Ditt antagningsbesked<br />Antagningsbesked skickas via e-post cirka två veckor före kursstart.&nbsp;<a href=https://sundsvall.alvis.se/>Se ditt antagningsbesked och följ din ansökan via Mina sidor</a>. ]]>',
