        N'<![CDATA[ <p style=margin-left:0cm; margin-right:0cm>Denna kurs är en av fyra fristående orienteringskurser inom “Din Framtid”.</p><p style=margin-left:0cm; margin-right:0cm>Denna kurs är för dig som vill veta mer om olika yrken och kompetensbehov på arbetsmarknaden för att bli tryggare i dina beslut inför studier och arbete. Under kursen får du möjlighet att planera tillsammans med en studie- och yrkesvägledare.</p><p style=margin-left:0cm; margin-right:0cm>I våra orienteringskurser utvecklas entreprenöriellt lärande, såsom initiativförmåga, kreativitet, ansvar och nyfikenhet. Kurserna ska även utveckla din digitala kompetens och språkliga förmåga.</p>Du har möjlighet att söka studiemedel för den här kursen.<br /><a href=http://www.csn.se/>Läs mer om studiemedel på&nbsp;www.csn.se</a>.<br />&nbsp;<br />Ditt antagningsbesked<br />Antagningsbesked skickas via e-post cirka två veckor före kursstart.&nbsp;<a href=https://sundsvall.alvis.se/>Se ditt antagningsbesked och följ din ansökan via Mina sidor</a>. ]]>',
