VALUES (2191, 985, N'YH Akademin AB', N'https://yh.se', N'YH00118',
        N'Affärsutvecklare besöksnäring', N'yrkeshögskoleutbildning',
        N'https://ya.se/yrkeshogskola/affarsutvecklare-besoksnaring/', 400.0,
        N'Har du lätt för att nätverka och tycker om att påverka? Då är den här utbildningen något för dig! Som affärsutvecklare arbetar du med att driva och utveckla ett företag eller organisation framåt. Du arbetar ofta nära ledningen och tar fram underlag genom att analysera nuläge och göra omvärldsanalyser för att kunna föreslå en bra väg framåt för företaget.Genom att utbilda dig till affärsutvecklare inom besöksnäring får du kompetens att utveckla och paketera tjänster inom turist- och besöksnäringen. Utbildningen ger dig verktyg att kunna analysera marknadstrender och att projektleda konceptutveckling och digitalt förändringsarbete.Besöksnäringen räknas som världens största och snabbast växande näring. Under kommande år förväntas den svenska besöksnäringens omfattning och exportvärde fortsätta öka. Därför finns det goda jobbmöjligheter för affärsutvecklare med rätt kompetens och utbildning. Yrkesrollen är också viktig då företag i dag har ständigt höga krav på förbättring och utveckling för att öka konkurrenskraften.',
        '2025-01-20 00:00:00.0000000', '2026-12-31 00:00:00.0000000', 100.0, NULL,
        '2024-11-06 01:00:00.0000000', N'Örnsköldsvik', N'525812z', NULL, NULL, N'8', N'0', NULL),
