       (2195, 989, N'Sundsvalls kommun, Vuxenutbildningen', N'https://www.yhmitt.se', N'YH01752',
        N'Informationssäkerhetsspecialist', N'yrkeshögskoleutbildning',
        N'https://sundsvall.se/utbildning-och-forskola/yrkeshogskolan-mitt', 200.0,
        N'Informationssäkerhet berör all tillgänglig information i såväl gammalt som nytt format. Det innebär all skyddsvärd information som finns nedskriven i pärmar, anteckningar och arkiv. Informationssäkerhet handlar mycket om hur medarbetare och ledning är skyldiga att hantera viss information, hur gammal information kan och ska gallras ut samt vad som inte får lagras överhuvudtaget, enligt gällande regelverk.Informationssäkerhet är de åtgärder som vidtas för att hindra att information läcker ut, förvanskas eller förstörs och för att informationen ska vara tillgänglig när den behövs. För en organisation kan det handla om att skydda information mot en uppsättning hot för att säkerställa verksamhetens kontinuitet, minimera verksamhetsrisken och maximera avkastningen på investeringar och affärsmöjligheter.Informationssäkerhetsbranschens kravprofil på medarbetare är en hög ämnesteoretisk kompetens samt även kompetenser som initiativförmåga, analytisk fallenhet, problemlösningsförmåga, samarbetsförmåga och driftighet till självständigt arbete.Utbildningen bedrivs på distans med nio fasta träffar på studieorten (Sundsvall).Studietakt 75 %. ',
        '2023-09-04 00:00:00.0000000', '2024-12-06 00:00:00.0000000', 75.0, NULL, NULL,
        N'Sundsvall', N'415869z', NULL, NULL, N'11', N'0', NULL),
       (2196, 990, N'Sundsvalls kommun, Vuxenutbildningen', N'https://www.yhmitt.se', N'YH01752',
