        '2023-04-15 00:00:00.0000000', N'Sundsvall', NULL, NULL, NULL, N'0', N'0', NULL),
       (2199, 993, N'Kramfors kommun, Yrkeshögskolan Höga kusten', N'www.yhk.se', N'YH00585',
        N'Mätningstekniker', N'yrkeshögskoleutbildning',
        N'https://www.yhk.se/utbildningar/matningstekniker/', 415.0,
        N'För en mätningstekniker är oftast inte den ena dagen lik den andra. Mätnings- teknikern är den som både kan planera och driva mätningsarbeten i projektet och som har koll på att ritningar och mätdata sköts på rätt sätt och ser till att toleranser och krav efterhålls. En mätningstekniker kan jobba med t.ex. mark- och anläggningsjobb hus- utsättning, byggverksamhet, upp-datering av stomnät, kartor och fastigheter, projekteringsmätning och inmätningar.  Arbetet består till stor del av samarbete med kollegor och kontakter med andra entreprenörer, privatpersoner, företag och myndigheter. VEM ÄR DU?För att trivas som mätningstekniker bör du tycka om att jobba med utmaningar och är bra på att hantera snabba ändringar som kan uppstå i ett projekt. Du tycker det är roligt med problemlösning, teknik och beräkning och tror dig vara modig nog att kunna tänka nytt när det krävs.UTBILDNINGENS INNEHÅLLUtbildningen innehåller bland annat kurser inom geodetisk mätningsteknik, mark- och anläggningsteknik, kartteknik samt yrkesmatematik.I kurserna använder du avancerade digitala mätinstrument som totalstationer, scanner och GPS-stationer, man mäter både optiskt och med hjälp av satelliter för att samla in mätdata.Du bearbetar sedan informationen i datorer med tillhör- ande beräknings och grafiska program. Under de två åren blandas teoretisk utbildning med fältövningar och praktiska tillämpningar. Stora delar av utbildningen sker ute på arbetsplatser (LIA- Lärande i arbete).VAR FINNS JOBBEN?Mätningsteknikerns kompetens är högt efterfrågad och jobben finns hos konsultföretag, entreprenörer, kommuner men även hos statliga organisationer som exempelvis Lantmäteriet Trafikverket och Vattenfall. Gruvnäring, elbolag och skogsbolag är branscher och organisationer som har behov av mätningsteknisk kompetens.Efter avslutad utbildningen kommer du att kunna söka jobb som mätnings- tekniker, mätningsingenjör, kart- och mätingenjör, karttekniker och lantmäteritekniker.ETT FRAMTIDSYRKE!Det råder idag och under lång tid fram- över stor brist på utbildade mätnings- tekniker. Konsultföretag, som erbjuder tjänster inom mätteknik, har ökat markant i landet och flera företagsledare uttrycker önskemål om att kunna expandera om man hittar kompetent personal.BÄSTA LÄRAREN ÄR VERKLIGHETENUtbildningen är upplagd så att du som studerande skall få så bra förutsättningar som möjligt i din kommande yrkesroll, en stor del av utbildningen sker därför ute på olika företag i kursen Lärande i arbete (LIA). ',
        '2023-08-21 00:00:00.0000000', '2025-05-16 00:00:00.0000000', 100.0, NULL,
        '2023-05-15 00:00:00.0000000', N'Kramfors', N'525580x', NULL, NULL, N'0', N'0', NULL),
       (2200, 994, N'Kramfors kommun, Yrkeshögskolan Höga kusten', N'www.yhk.se', N'YH00585',
        N'Mätningstekniker', N'yrkeshögskoleutbildning',
        N'https://www.yhk.se/utbildningar/matningstekniker/', 415.0,
