råder idag och under lång tid fram- över stor brist på utbildade mätnings- tekniker. Konsultföretag, som erbjuder tjänster inom mätteknik, har ökat markant i landet och flera företagsledare uttrycker önskemål om att kunna expandera om man hittar kompetent personal.BÄSTA LÄRAREN ÄR VERKLIGHETENUtbildningen är upplagd så att du som studerande skall få så bra förutsättningar som möjligt i din kommande yrkesroll, en stor del av utbildningen sker därför ute på olika företag i kursen Lärande i arbete (LIA). ',
        '2024-08-19 00:00:00.0000000', '2026-05-15 00:00:00.0000000', 100.0, NULL,
        '2024-04-15 02:00:00.0000000', N'Kramfors', N'525580x', NULL, NULL, N'0', N'0', NULL);
