VALUES (2201, 995, N'YH Akademin AB', N'https://yh.se', N'YH00949',
        N'Robot och automationsprogrammerare', N'yrkeshögskoleutbildning',
        N'https://yh.se/utbildningar/robot-och-automationsprogrammerare/', 300.0,
        N'Idag är automatiserade system vardag inom branscher där det förut inte var tänkbart. Detta gäller inte bara tillverkningsindustri och logistik utan också vård, omsorg och sociala funktioner kommer att automatiseras. ??Som robot och automationsprogrammerare har du övergripande kunskap om olika programmeringsspråk inom automation. Du konstruerar, diagnostiserar och åtgärdar felkoder, samt avgör vilken automationslösning som är bäst lämpad till en applikation. ??Jobbmöjligheter ?Bristen på kompetens stoppar idag företagens utveckling och övergången till en mer automatiserad produktion. Detta öppnar upp för en mycket gynnsam arbetsmarknad med stora möjligheter till karriär opåverkad av konjunkturlägen.Ta ditt nästa karriärsteg hos oss på YrkesAkademin Yrkeshögskola',
