        N'Som tandsköterska har du stort ansvar för klinikens hygien och smittskydd, administrativa uppgifter samt receptionsarbete. I yrkesrollen ingår t.ex.  att ha egna patienter, ge munhygien och tandhälso-information, utföra profylax, tandhälsokontroller, avtryckstagning samt fluorbehandling. Tandsköterskan förbereder även behandling, blandar material och sterilisera instrument.Tandläkare kan även delegera uppgifter till tandsköterskan, som t.ex. att ge lokalbedövning, ta röntgenbilder och göra enklare fyllningar. Tandsköterska är ett serviceyrke med mycket patientkontakt vilket innebär att bemötandet är viktigt samt att du ska inge trygghet och tillit.Jobbmöjligheter Det är stor efterfrågan på tandsköterskor. En stor andel pensionsavgångar samt framtidens krav på välutbildad personal inom tandvården lägger grunden för rekryteringsbehovet. Utbildningen är skräddarsydd för att tillgodose branschens behov av kompetenta tandsköterskor och efter utbildningen har du de kunskaper och färdigheter som efterfrågas. Föreläsningar varvas med Lärande i arbete, LIA.Ta ditt nästa karriärsteg hos oss på YH Akademin!',
