       (2213, 1003, N'Sundsvalls kommun, Vuxenutbildningen', N'https://www.yhmitt.se', N'YH01782',
        N'Logistiksamordnare', N'yrkeshögskoleutbildning',
        N'https://sundsvall.se/utbildning-och-forskola/yrkeshogskolan-mitt', 400.0,
        N'Logistik berör alla verksamheter på ett eller annat sätt; inom såväl det kommersiella som inom transport och samhällsnytta, och oberoende av om det rör varor eller tjänster, privat eller offentlig sektor.De stora satsningar på E-handel, transporter och logistikanläggningar, liksom behovet av en krisberedskap för vatten-, livsmedel-, bränsle- och läkemedelsförsörjning, ökar efterfrågan på yrkesrollen. Därtill har yrket förändrats genom tekniska innovationer och digitalisering, samt ett hållbarhets- och miljötänk som kräver uppdaterad utbildning inom dessa områden för en logistiksamordnare.För att kunna skapa effektiva logistiklösningar är det viktigt att kunna se de olika flöden som finns i en verksamhet; både gods- och materialflöden och informations- och kapitalflöden.Som logistiksamordnare behöver man ha både teoretiskt och praktiskt kunnande, samt en utvecklad problemlösningsförmåga. Man måste kunna arbeta på både en strategisk och en operativ nivå med olika logistiklösningar, och yrkesrollen kräver att man kan planera för hela logistikflöden och ha beställarkompetens för att kunna knyta till sig spetskunskap där så krävs.',
        '2024-01-08 00:00:00.0000000', '2025-12-19 00:00:00.0000000', 100.0, NULL, NULL,
        N'Sundsvall', N'525349z', NULL, NULL, N'0', N'0', NULL),
       (2214, 1004, N'Hermods AB Umeå', N'https://www.hermods.se', N'YH01784',
        N'Underhållsingenjör – Smart Maintenance', N'yrkeshögskoleutbildning',
        N'https://hermods.se/utbildningar/underhallsingenjor-smart-maintenance/umea/?utm_source=myh&utm_medium=organic&utm_campaign=yh',
        400.0,
        N'Är du tekniskt intresserad och vill arbeta med hållbara och energieffektiva lösningar inom industrin? Som underhållsingenjör arbetar du med planering, genomförande, uppföljning och analys av underhållsinsatser. Du samordnar och leder maskinunderhållet i verksamhetens anläggningar. Du arbetar både strategiskt och operativt. Tillhör ofta en arbetsgrupp av tekniker och projektörer.Yrket passar dig som vill arbeta med att underhålla och effektivisera maskiner och teknik inom industri och tillverkning. Utbildningen fokuserar på underhållsingenjör utbildning, energieffektivitet och hållbar teknik för att möta arbetsmarknadens kompetensbehov inom Smart Maintenance. Kanske har du gått bygg- och anläggning på gymnasiet, eller el- och energi eller inom industrin. Du behöver inte arbeta inom underhållsindustrin idag. Eller så gör du just det och vill få verifierat och ytterligare kompetens inom Smart Maintenance-området. Kanske vill du avancera i din nuvarande yrkesroll? Du kan även arbeta inom fastighetsbranschen, kanske som tekniker inom fastighet.Vårt program innehåller bland annat underhållsingenjör utbildning som gör dig kvalificerad att jobba inom Smart Maintenance. Smart Maintenance handlar om smarta lösningar inom underhåll. Något som marknaden efterfrågar mer och mer. Ofta arbetar man med ett intelligent underhållssystem (IMS) som använder insamlad data från maskiner för att förutsäga och förhindra potentiella fel i dem. Förekomsten av fel i maskiner kan vara kostsamt och till och med katastrofalt. För att undvika fel måste det finnas ett system som analyserar maskinens beteende och ger larm och instruktioner för förebyggande underhåll. Att analysera maskinernas beteende har blivit möjligt med hjälp av avancerade sensorer, datainsamlingssystem, datalagrings-/överföringsmöjligheter och dataanalysverktyg. Aggregeringen av datainsamling, lagring, transformation, analys och beslutsfattande för smart underhåll kallas ett intelligent underhållssystem (IMS).',
        '2023-08-28 00:00:00.0000000', '2025-05-23 00:00:00.0000000', 100.0, NULL, NULL,
        N'Örnsköldsvik', N'525521c', NULL, NULL, N'6', N'0', NULL),
