        N'Som produktionsutvecklare arbetar du med att effektivisera flöden, processer, produktionsteknik och mekaniska konstruktioner. Ditt mål är en produktion med kortare omställnings- och ledtider, färre fel, mer flexibilitet och ingen tidskrävande programmering. Idag har vi konstant tillgång till data i realtid utan begränsningar vilket skapar möjligheter om datan nyttjas korrekt. Med den ökade digitaliseringen är vi snabbt på väg in i den fjärde industriella revolutionen – Industri 4.0. Målet är självorganiserande fabriker, där varje produkt bär med sig information om hur och till vem den ska tillverkas. Branschen har redan svårt att rekrytera personer med rätt kompetens till deras lediga tjänster. Digitaliseringen och den tekniska utvecklingen driver på efterfrågan av produktteknisk kompetens och industrin står inför stora pensionsavgångar. Möjliga yrkesroller efter utbildningen: - Produktionsutvecklare - Produktionstekniker - Industriell förbättringsledare / Projektledare i produktion - Operativ beredare / Produktionsberedare - Kvalitetstekniker - LEAN koordinator Ta nästa steg i karriären hos YH Akademin! Som produktionsutvecklare arbetar du med att effektivisera flöden, processer, produktionsteknik och mekaniska konstruktioner. Ditt mål är en produktion med kortare omställnings- och ledtider, färre fel, mer flexibilitet och ingen tidskrävande programmering. Idag har vi konstant tillgång till data i realtid utan begränsningar vilket skapar möjligheter om datan nyttjas korrekt. Med den ökade digitaliseringen är vi snabbt på väg in i den fjärde industriella revolutionen – Industri 4.0. Målet är självorganiserande fabriker, där varje produkt bär med sig information om hur och till vem den ska tillverkas. Branschen har redan svårt att rekrytera personer med rätt kompetens till deras lediga tjänster. Digitaliseringen och den tekniska utvecklingen driver på efterfrågan av produktteknisk kompetens och industrin står inför stora pensionsavgångar. Möjliga yrkesroller efter utbildningen: - Produktionsutvecklare - Produktionstekniker - Industriell förbättringsledare / Projektledare i produktion - Operativ beredare / Produktionsberedare - Kvalitetstekniker - LEAN koordinator Ta nästa steg i karriären hos YH Akademin! ',
